import React, { Component } from 'react';

import './TrailerVideo.css';

class TrailerVideo extends Component {
    render(){
        return(
            <div id='videoContainer'>
                <iframe width="1584" height="588" src="https://www.youtube.com/embed/ZjJUVsmjIj4" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>
        )
    }
}

export default TrailerVideo;
